import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 59.1-165 Chemical analysis as evidence.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-165.md","filePath":"vacode/59.1-165.md"}'),o={name:"vacode/59.1-165.md"},r=i('<h1 id="§-59-1-165-chemical-analysis-as-evidence" tabindex="-1">§ 59.1-165 Chemical analysis as evidence. <a class="header-anchor" href="#§-59-1-165-chemical-analysis-as-evidence" aria-label="Permalink to &quot;§ 59.1-165 Chemical analysis as evidence.&quot;">​</a></h1><p>A certificate of analysis of any motor fuel or lubricating oils shall be admitted into evidence in any case relating to such motor fuel or lubricating oil that involves an alleged violation of this chapter or regulation adopted thereunder, provided that the requirements of subsection A of § <a href="http://law.lis.virginia.gov/vacode/19.2-187.1/" target="_blank" rel="noreferrer">19.2-187.1</a> have been satisfied and the accused has not objected to the admission of the certificate pursuant to subsection B of § <a href="http://law.lis.virginia.gov/vacode/19.2-187.1/" target="_blank" rel="noreferrer">19.2-187.1</a>.</p><p>Code 1950, § 59-58; 1968, c. 439; 1972, c. 741; 1992, c. 885; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0152" target="_blank" rel="noreferrer">152</a>.</p>',3),n=[r];function s(c,l,d,h,_,f){return a(),t("div",null,n)}const u=e(o,[["render",s]]);export{p as __pageData,u as default};
